import React, { Component } from 'react';
import { render } from 'react-dom';
import Typed from 'react-typed';
import Grid from '@material-ui/core/Grid';


export default class Home extends Component {
    render() {
        return (
            <div style={{
                width: '100%',
                height: 'auto'
            }}>
                <div style={{
                    width: '100%',
                    height: '400px',
                    background: '#00363d',
                    marginTop: '70px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center'
                }}>
                    <Typed style={{
                        fontFamily: 'Karla',
                        fontSize: 30,
                        color: '#ffffff',
                    }}
                        strings={[
                            'J. Allan Hobson',
                            'Professor of Psychiatry',
                            'Harvard Medical School']}
                        typeSpeed={40}
                        backSpeed={50}
                        loop >
                    </Typed>


                </div>
                <div style={{
                    width: '100%',
                    height: '500px',
                    background: '#cccccc'

                }}>
                    <Grid
                        container
                        direction="row"
                        justify="center"
                        alignItems="center"
                    >
                        <h3>REM sleep and dreaming: towards a theory of protoconsciousness</h3>
                    </Grid>

                </div>




            </div>
        )
    }
}

render(
    <Home />,
    document.getElementById('root'),
);
